import React from 'react'
import styled from 'styled-components';

function Account() {
    return (
        <Container>
            <ContentAccount>
                Your Account
            </ContentAccount>
            <ContentAccountDiv>
                <ThreeDiv>1</ThreeDiv>
                <ThreeDiv>2</ThreeDiv>
                <ThreeDiv>3</ThreeDiv>
            </ContentAccountDiv>
            <ContentAccountDiv>2</ContentAccountDiv>
            <ContentAccountDiv>3</ContentAccountDiv>
        </Container>
    )
}

export default Account

const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: orange;
    margin-top: 20px;
    flex-direction: column;
`
const ContentAccount = styled.div`
    margin-left:-30%;
    font-size:30px;
`

const ContentAccountDiv = styled.div`
    background-color: red;
    width:70%;
    height:40%;
    margin:10px 0px;
    display: flex;
    align-items: space-around;
`
const ThreeDiv = styled.div`
   border: 1px solid black;

`
